function bFind(saValue, sText, bExact)
{
   sText = sText.trim();
   for(var i = 0; i < saValue.length; i++)
   {
      if(!bExact && sText.indexOf(saValue[i]) != -1)
        return true;
      else if(bExact && sText == saValue[i])
        return true;
   }
   return false;
}

