function findParentWithClass(node, class_name, count)
{
  if (count == 0 || node === undefined || !node)
		return null;
 
  if (node.className !== undefined)
  {
  var classes = node.className; 
  //alert(classes);
  
  if(classes.indexOf(class_name) == 0)
  {
  	//alert(classes);
   	return node;
  }
   else
	   return findParentWithClass(node.parentNode, class_name, count-1); 
  }
   else
	   return findParentWithClass(node.parentNode, class_name, count-1); 
}

function myFunction(sMode, sExtraGood, sExtraBad, bCheckMain, bRedirect) 
{     
    var sSubMode = "";
    var index = sMode.indexOf(":");
    if (index !== -1)
    {
     sSubMode = sMode.substring(index+1); 
     sMode = sMode.substring(0, index); 
    }

    if (sMode == "tv25")
    {       
        var btn = document.querySelectorAll('.fc-close');
        //console.log(btn);
        btn[0].click();
    }
    
    var sAllGood = sBigGood + sExtraGood;
    var sAllBad = sBigBad + sBigBad2 + sExtraBad;
    var saGood = sAllGood.split(",");
    var saBad = sAllBad.split(",");
    
    var imgs = document.querySelectorAll('img');
    
    for (var i = 0; i< imgs.length; i++) 
    {
    	imgs[i].style.visibility = "hidden";
    	imgs[i].style.display = "none";
    	imgs[i].width = 0;
    	imgs[i].height = 0;
    
    }    
    
    var anchors = document.querySelectorAll('a');
	if (sMode == "div")
		anchors = document.querySelectorAll('div');
    var link = [];
    var goodElement, badElement;
    for (var i = 0; i< anchors.length; i++) 
    {
      link = anchors[i];
      goodElement = link;
      badElement = link.parentNode.parentNode;
      
      //console.log(link.innerHTML);
      //alert(link.innerHTML);
      if (sMode == "ktownstory")
      {
      }
      else if (sMode == "s")
      {
          badElement = link;
      }
      else if (sMode == "p")
      {
          badElement = link.parentNode;
      }
      else if (sMode == "ppp" || sMode == "kotbc")
      {
          badElement = link.parentNode.parentNode.parentNode;
      }
      else if (sMode == "pppp" || sMode == "tv25")
      {
	      badElement = link.parentNode.parentNode.parentNode.parentNode;
      }
      else if (sMode == "pp" || sMode == "tv25m" || sMode == "viva")
      {
	      badElement = link.parentNode.parentNode;
      }
      
      if (bCheckMain && bFind(saBad, link.innerHTML, false)) 
      {
    	//alert(link.innerHTML);
    	//console.log("bad: " + link.innerHTML);
	
	if(sSubMode != "")
	{
	  var hasCSS = findParentWithClass(link.parentNode, sSubMode, 10);
          if(hasCSS !== undefined && hasCSS !== null)
		badElement = hasCSS; 	
	}
	
	badElement.style["display"] = "none";
      }	
      else if (bCheckMain && bFind(saGood, link.innerHTML, false)) 
      {
    	//alert(link.innerHTML);
        goodElement.style["font-weight"] = "bold";
    	  goodElement.style["font-size"] = "18px";
    	  goodElement.style["color"] = "#53a822";
    	//console.log("good: " + link.innerHTML);
      }
      else if (sMode == "kotbc" && bCheckMain && link.innerHTML.indexOf("Update!") != -1) 
      {
    		//alert(link.innerHTML);
    		//console.log("bad: " + link.innerHTML);
        link.parentNode.style["display"] = "none";
      }	      
      else if (bCheckMain && sMode == "tv25m" && link.href.indexOf("/tv_shows/") != -1) 
      {
        //alert(link.innerHTML);
        //console.log("bad: " + link.innerHTML);
        badElement.style["display"] = "none";
      }   
      else if (bRedirect && (link.innerHTML.indexOf("airst") != -1 
      || link.innerHTML.indexOf("filemoon") != -1
      || link.innerHTML.indexOf("luulu") != -1
      )) 
      {
      	//console.log("finish ==================== : ");
      	setTimeout(function(){
        	var win = window.open(link.href, "_self");
    		win.focus();
      	}, 1000);
    		break;
      }
    }
}
